package homeclean.external;

public class payHistory {

    private Long id;
    private String rsvNo;
    private Double pay;


    public Long getId() {
        return id;
    }

    public void setId(Long id) {
        this.id = id;
    }
    public String getRsvNo() {
        return rsvNo;
    }

    public void setRsvNo(String rsvNo) {
        this.rsvNo = rsvNo;
    }
    public Double getPay() {
        return pay;
    }

    public void setPay(Double pay) {
        this.pay = pay;
    }

}

